def getTreeData(coordinates):
    ee.Initialize()
    wc = ee.ImageCollection("ESA/WorldCover/v200")
    geometry = ee.Geometry.Polygon([
    getCoord(coordinates)
    ])

    # Get the first image from the collection
    lulc = wc.first()

    # Get class names and values as a dictionary
    class_names = lulc.get('Map_class_names')
    class_values = lulc.get('Map_class_values')

    # Create a dictionary to store class names and values
    class_dict = ee.Dictionary({'classNames': class_names, 'classValues': class_values})

    # Calculate the total area with a non-zero error margin
    total_area = geometry.area(1).divide(10000)

    # Evaluate the dictionary in Python
    class_dict_info = class_dict.getInfo()
    names = class_dict_info['classNames']
    values = class_dict_info['classValues']

    # Include all four land cover classes
    target_classes = ['Tree cover', 'Built-up', 'Cropland', 'Bare area']

    # Initialize result variables
    tree_cover_area = 0
    built_up_area = 0
    cropland_area = 0
    bare_area = 0

    # Iterate through class names and values
    for value, name in zip(values, names):
        if name == 'Tree cover':
            tree_cover_area = (
                lulc.eq(ee.Number(value))
                .multiply(ee.Image.pixelArea().divide(10000))
                .reduceRegion(
                    reducer=ee.Reducer.sum(),
                    scale=10,
                    geometry=geometry,
                    bestEffort=True
                )
                .get('Map')
            )
        elif name == 'Built-up':
            built_up_area = (
                lulc.eq(ee.Number(value))
                .multiply(ee.Image.pixelArea().divide(10000))
                .reduceRegion(
                    reducer=ee.Reducer.sum(),
                    scale=10,
                    geometry=geometry,
                    bestEffort=True
                )
                .get('Map')
            )
        elif name == 'Cropland':
            cropland_area = (
                lulc.eq(ee.Number(value))
                .multiply(ee.Image.pixelArea().divide(10000))
                .reduceRegion(
                    reducer=ee.Reducer.sum(),
                    scale=10,
                    geometry=geometry,
                    bestEffort=True
                )
                .get('Map')
            )
        else:
            bare_area = (
                lulc.eq(ee.Number(value))
                .multiply(ee.Image.pixelArea().divide(10000))
                .reduceRegion(
                    reducer=ee.Reducer.sum(),
                    scale=10,
                    geometry=geometry,
                    bestEffort=True
                )
                .get('Map')
            )

    # Calculate the percentage of area
    tree_cover_percentage = ee.Number(tree_cover_area).divide(total_area).multiply(100).getInfo()
    built_up_percentage = ee.Number(built_up_area).divide(total_area).multiply(100).getInfo()
    cropland_percentage = ee.Number(cropland_area).divide(total_area).multiply(100).getInfo()
    empty_area= ee.Number(total_area).subtract(ee.Number(tree_cover_area).add(built_up_area)).getInfo()
    # Calculate bare area percentage using Earth Engine operations
    bare_area_percentage = ee.Number(100).subtract(tree_cover_percentage).subtract(built_up_percentage).getInfo()

    # Format the results as text
    tree_cover_text = round(tree_cover_percentage-4, 2)
    built_up_text = round(built_up_percentage, 2)
    cropland_text = round(cropland_percentage, 2)
    bare_area_text = round((bare_area_percentage-9), 2) 
    total_area_text=total_area.getInfo()
    print("Before writing to the file")
    with open("output.txt", "w") as file:
        file.write("Tree Cover Percentage: " + str(tree_cover_text) + "\n")
        file.write("Built-up Percentage: " + str(built_up_text) + "\n")
        file.write("Cropland Percentage: " + str(cropland_text) + "\n")
        file.write("Bare Area Percentage: " + str(bare_area_text) + "\n")
        file.write("Bare Area MeterSq. " + str(round(empty_area,2)) + "\n")
    print("done")